    function addNote(note) {
        console.log(note);
    }

    return (
        <div>
            <Header />
            <CreateArea onAdd={addNote} />
            <Note key={1} title="Note Title" content="Note Content" />
            <Footer />
        </div>
    )
}

export default App;
